import React from 'react';
import "./footer.css";
import { useMediaQuery } from 'react-responsive';
import MenuIcon from '@mui/icons-material/Menu';

export default function NavBar() {
  const isDesktopOrLaptop = useMediaQuery({
    query: '(min-width: 811px)'
  })

  const isTabletOrMobile = useMediaQuery({
      query: '(max-width: 810px) and (min-width: 711px)'
  })

  const isPorttrait = useMediaQuery({
      query: '(max-width: 710px)'
  })

return (
<div>
    {isDesktopOrLaptop && 
      <div>
        <div className="footer-l">
          <div className="footerBos-l footerLeft-l"></div>
          <div className="footerBos-l footerMiddle-l"></div>
          <div className="footerBos-l footerRight-l"></div>
        </div>
      </div>
    }
    {isTabletOrMobile && <p></p>}
    {isPorttrait && <p></p>}
</div>
)
}
